// StudentLogin.js

import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom'; // Import useNavigate from react-router-dom
import { Typography } from '@mui/material';
import GoogleLoginButton from './googleLogin';
import './studentLogin.css';

function StudentLogin() {
    const [clientName, setClientName] = useState('');
    const navigate = useNavigate();

    const responseMessage = (response) => {
        const { name } = response;
        setClientName(name);
        navigate('/Home');
    };

    const errorMessage = (error) => {
        console.log('Student Login Failed:', error);
    };

    useEffect(() => {
        const isLoggedIn = localStorage.getItem('isLoggedIn');
        if (isLoggedIn) {
            navigate('Home');
        }
    }, [navigation]);

    return (
        <div className="student-login-container">
            <Typography variant="h4" component="h2" gutterBottom className="student-login-title">Student Login</Typography>
            <GoogleLoginButton onSuccess={responseMessage} onError={errorMessage} className="student-login-button" />
        </div>
    );
}

export default StudentLogin;
